import './SortBox.css'

function SortElement (props) {
    return(
        <div className="SortElement" style={{height: (props.height + 20 + 'px')}}/>
    )
}

export default function SortBox(props) {
    return (
        <div className="SortBox">
            <div className="SortBoxElements">
                {props.array.map(x => {
                    return(
                        <SortElement height={x} />
                    )
                })}
            </div>
        </div>
    )
}
